import React from 'react';

interface LogoProps {
  className?: string;
}

export const Logo: React.FC<LogoProps> = ({ className = "h-10" }) => {
  // FÃ¼ge hier dein Base64-Logo ein (beginnt mit: data:image/png;base64,...)
  // Konvertiere dein Logo hier: https://www.base64-image.de/
  const logoBase64 = "data:image/png;base64,";
  
  const [hasError, setHasError] = React.useState(false);

  // Wenn kein Logo gesetzt ist oder es einen Fehler gibt, zeige Text-Logo
  if (!logoBase64 || hasError) {
    return (
      <div className="flex items-center gap-1 select-none">
        <span className="font-serif text-2xl md:text-3xl font-bold text-white tracking-tight">
          Interior<span className="text-[#FFD700]">Glanz</span>
        </span>
      </div>
    );
  }

  return (
    <img 
      src={logoBase64}
      alt="InteriorGlanz Logo" 
      className={`${className} object-contain`}
      onError={() => setHasError(true)}
      loading="eager"
    />
  );
};